import React from "react";
import {Data} from "./Data"

const Store=()=>{
    console.log(Data);
    return(
        <>
            <div className="container">
        

                    <div className="container">
                    {Data.map((file, index)=>(
                        <div className="d-flex">
                        <img src="" class="card-img-top" alt="..." />
                        
                          <h5 className="card-title">text</h5>
            
                        </div>
                    ))}
                        
                    </div>
    
      </div>
        </>
    )
}
export default Store;
